import React from "react";
import styled from "styled-components";

const Section = styled.section`
    min-height: ${props => `calc(100vh - ${props.theme.navHeight})`};
    width: 100vw;
    position: relative;
    background-color: ${props => props.theme.text};
`;

const Home = () => {
    return (
        <Section>
            Home
        </Section>
    );
}

export default Home;
